import React, { Component } from "react";
import "./donate.css";
import TopNavBar from "../TopNavbar/TopNavbar";
import BottomNavBar from "../BottomNavbar/BottomNavbar";

export default class Donate extends Component {
  render() {
    return (
      <div>
          <div>
              <TopNavBar/>
          </div>
        <div class="container">
          <div class="row">
            <div class="col">
              <img  className="donate-img"
                src="https://images.squarespace-cdn.com/content/v1/57f0499ed1758e2d78db7dbe/1596510580079-OP4AOKT4RUF5K96LHA6L/ke17ZwdGBToddI8pDm48kEVD3VL2-LN5uCf14nNy-gJ7gQa3H78H3Y0txjaiv_0fDoOvxcdMmMKkDsyUqMSsMWxHk725yiiHCCLfrh8O1z5QHyNOqBUUEtDDsRWrJLTmgbBA9KfxWpJIziZzus6eiJ3anRBcoZ4PlSV5T-a8Z34ZlDfdHw-NNZ1VFaEnb6n_/DSC_1178.jpg?format=300w"
              ></img>
            </div>
            <div class="col">
              <img className="donate-img" src="https://images.squarespace-cdn.com/content/v1/57f0499ed1758e2d78db7dbe/1596510580121-466W2JPGF69I29NB9C4S/ke17ZwdGBToddI8pDm48kEVD3VL2-LN5uCf14nNy-gJ7gQa3H78H3Y0txjaiv_0fDoOvxcdMmMKkDsyUqMSsMWxHk725yiiHCCLfrh8O1z5QHyNOqBUUEtDDsRWrJLTmgbBA9KfxWpJIziZzus6eiJ3anRBcoZ4PlSV5T-a8Z34ZlDfdHw-NNZ1VFaEnb6n_/DSC_1194.jpg?format=300w"></img>
            </div>
          </div>
        </div>
        <div>
              <BottomNavBar/>
          </div>
      </div>
    );
  }
}
